import React, { useState } from 'react';

import ApiOpenAI from './ApiOpenAI';
import ApiBc49 from './ApiBc49';
import ApiLotto649 from './ApiLotto649';
import ApiLottoMax from './ApiLottoMax';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css'

const url = 'http://localhost:5000/api/openai';
const url1 = 'http://localhost:5000/api/lotto/bc49';
const url2 = 'http://localhost:5000/api/lotto/lotto649';
const url3 = 'http://localhost:5000/api/lotto/lottomax';

const SelectLotto = (value) => {

    const [selectedLotto, setSelectedLotto] = useState('')

    const handleChange = (event) => {

        setSelectedLotto(event.target.value)
        switch (selectedLotto) {
            case 'BC49':
                return (<div><ApiBc49 endpoint={url1} /> </div>)
            case 'Lotto649':
                return (<div><ApiLotto649 endpoint={url2} /> </div>)
            case 'LottoMax':
                return (<div><ApiLottoMax endpoint={url3} /> </div>)
    
            default: return  (<div><ApiOpenAI endpoint={url} /> </div>)
        }
    }
    return (
        <div>
          <h1>Select Lottos</h1>
          <label htmlFor="tableSelector">Select a Table:</label>
          <select id="tableSelector" onChange={handleChange}>
            <option value="">Select a Lottery</option>
            <option value="MyOpenAI">LottoMax</option>
            <option value="BC49">BC49</option>
            <option value="LottoMax">LottoMax</option>
            <option value="Lotto649">Lotto649</option>
            {/* Add more table options as needed */}
          </select>
          {selectedLotto && (
            <div>
              <p>Displaying content for {selectedLotto}</p>
              {/* Add logic here to render the content for the selected table */}
            </div>
          )}
        </div>
      )
}

export default SelectLotto
